import { Button, Container, Nav, Navbar, Stack } from "react-bootstrap";

export const Header = () => {
  return (
    <Stack direction="horizontal" gap={2}>
      <Button as="a" variant="primary">
        Button as link
      </Button>
      <Button as="a" variant="success">
        Button as link
      </Button>
    </Stack>
  );
};
